import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";
import CreateArea from "./CreateArea";

function App() {
  return (
    <div>
      <Header />
      <CreateArea />
      {notes.map( temp => (  
      <Note 
        key={temp.key} 
        title={temp.title} 
        content={temp.content} 
      />
      ))}
      <Footer />
    </div>
  );
}

export default App;
